import React, { useState, useEffect } from "react";
import axios from "axios";

const Home = () =>{
    const [user, setUser] = useState([]);
    useEffect(()=>{
        loadUser();
    },[]);

    const loadUser = async () =>{
        const result = await axios.get("http://localhost:3001/users");
        console.log("Data::::::" + result);
    }
    return(
        <>
            Home Page
        </>
    );
}
export default Home;
